MongoDB: Dynamic Counts<p>I have two collections. A 'users' collection and an 'events' collection. There is a primary key on the events collection which indicates which user the event belongs to.</p>

<p>I would like to count how many events a user has matching a certain condition.</p>

<p>Currently, I am performing this like:</p>

<pre class="lang-js prettyprint-override"><code>
db.users.find({ usersMatchingACondition }).forEach(user =&gt; {

  const eventCount = db.events.find({
    title: 'An event title that I want to find',
    userId: user._id
  }).count();

  print(`This user has ${eventCount} events`);

});

</code></pre>

<p>Ideally what I would like returned is an array or object with the UserID and how many events that user has.</p>

<p>With 10,000 users - this is obviously producing 10,000 queries and I think it could be made a lot more efficient!</p>

<p>I presume this is easy with some kind of aggregate query - but I'm not familiar with the syntax and am struggling to wrap my head around it.</p>

<p>Any help would be greatly appreciated!</p>

